import React from "react";
import { NavLink } from "react-router-dom";
import logo from "../../images/logo.svg";
import "./WindowWithForm.css";

export default function WindowWithForm({children}) {
  return (
    <section className="window-form">
      <NavLink to={"/"}><img src={logo} alt="Логотип сайта про диплом" className="window-form__logo link" /></NavLink>
      <h2 className="window-form__title">Добро пожаловать!</h2>
      <form action="" className="window-form__form">
        <div className="window-form__fieldset">
        <label htmlFor="window-form-name" className="window-form__input-lebel" required>Имя</label>
        <input type="text" className="window-form__input" id="window-form-name" />
        <span className="window-form__error"></span>
        <label htmlFor="window-form-email" className="window-form__input-lebel">E-mail</label>
        <input type="email" className="window-form__input" id="window-form-email" />
        <span className="window-form__error"></span>
        <label htmlFor="window-form-password" className="window-form__input-lebel">Пароль</label>
        <input type="text" className="window-form__input" id="window-form-password" />
        <span className="window-form__error"></span>
        </div>
        <button className="window-form__form-btn btn"></button>
      </form>
      {children}
    </section>
  )
}
